import React from "react";
import leavepic from "../../pages/assets/leavepic.jpg"

// reactstrap components
import { Button, Container, Row, Col } from "reactstrap";

function UserHeader() {
  return (
    <>
     
        <br></br>
        {/* Mask */}
        <span className="mask bg-gradient-default opacity-8" />

        <div className="center">
            <img src={leavepic} alt="leavepic"/>
         </div>

        {/* Header container */}
        <Container className="d-flex align-items-center" fluid>
          
          <Row>
            <Col lg="7" md="10">
              <h1 className="display-5 text-black">Hello Sheikha Hanna!</h1>
              <p className="text-black mt-0 mb-5">
                This is your profile page. You can see the progress you've made
                with your work and manage personal information.
              </p>
              
            </Col>
          </Row>
        </Container>
     
    </>
  );
}

export default UserHeader;
